class "WallMap"

function WallMap:__init()
end

function WallMap:DistanceSquared(a, b)
	local dx, dy = b.x - a.x, b.y - a.y
	return dx * dx + dy * dy
end

function WallMap:IsWall(pos, converted)
	local x, y = converted and pos.x or Round(pos.x / 30),
		converted and pos.y or Round((pos.z or pos.y) / 30)
	local map = Walls[MapID][x]
	return map ~= nil and map[y] ~= nil
end

function WallMap:IntersectsWall(p1, p2)
	local p1, p2 = {x = Round(p1.x / 30), y = Round(p1.y / 30)},
		{x = Round(p2.x / 30), y = Round((p2.z or p2.y) / 30)}
	local dx, dy = MathAbs(p1.x - p2.x), MathAbs(p1.y - p2.y)
	local sx, sy = p2.x < p1.x and 1 or -1, p2.y < p1.y and 1 or -1
	local tx, ty, e1, e2 = p2.x, p2.y, (dx > dy and dx or -dy) / 2
	while true do
		if self:IsWall({x = tx, y = ty}, true) then return true end
		if tx == p1.x and ty == p1.y then return false end; e2 = e1
		if e2 > -dx then e1, tx = e1 - dy, tx + sx end
		if e2 < dy then e1, ty = e1 + dx, ty + sy end
	end
end

function WallMap:FindClosestWall(pos, range)
	local size, squared, pos = MathCeil(range / 30), range * range / 900,
		{x = Round(pos.x / 30), y = Round((pos.z or pos.y) / 30)}
	local tx, ty, dx, dy = 0, 0, 0, -1
	for i = 1, size * size do
		local ax, ay = MathAbs(tx), MathAbs(ty)
		if ax == ay and not (dx == 1 and dy == 0)
			or tx > 0 and ty == 1 - tx then
				dx, dy = -dy, dx
		end
		if ax > size / 2 or ay > size / 2 then
			dx, dy = -dy, dx
			tx, ty = -ty + dx, tx + dy
		end
		local test = {x = pos.x + tx, y = pos.y + ty}
		if self:IsWall(test, true) then
			return self:DistanceSquared(pos, test) <= squared
				and {x = test.x * 30, y = test.y * 30} or nil
		end
		tx, ty = tx + dx, ty + dy
	end
	return nil
end

