		if enemy and InterrupterSpells[enemy.charName] then
			for j, spell in pairs(InterrupterSpells[enemy.charName]) do
				self.VayneMenu.Interrupter.Spells:MenuElement({id = j, name = enemy.charName .. " " .. spell.slot
					.. " [" .. spell.displayName .. "]", type = MENU, leftIcon = Icons .. spell.name .. Png})
				self.VayneMenu.Interrupter.Spells[j]:MenuElement({id = "Use", name = "Detect Spell", value = true})
				self.VayneMenu.Interrupter.Spells[j]:MenuElement({id = "Danger", name = "Danger Level",
					value = spell.danger, min = 1, max = 3, step = 1})
			end
		end
	end
	self.VayneMenu:MenuElement({id = "KillSteal", name = "KillSteal", type = MENU})
	self.VayneMenu.KillSteal:MenuElement({id = "UseE", name = "E [Condemn]", value = true, leftIcon = Icons.."VayneE"..Png})
	self.VayneMenu:MenuElement({id = "Drawings", name = "Drawings", type = MENU})
	self.VayneMenu.Drawings:MenuElement({id = "DrawQ", name = "Q: Draw Range", value = true})
	self.VayneMenu.Drawings:MenuElement({id = "DrawE", name = "E: Draw Range", value = true})
	self.VayneMenu.Drawings:MenuElement({id = "Track", name = "Track Enemies", value = true})
	self.VayneMenu:MenuElement({id = "Misc", name = "Misc", type = MENU})
	self.VayneMenu.Misc:MenuElement({id = "BlockAA", name = "Block AA While Stealthed", value = false})
	self.VayneMenu.Misc:MenuElement({id = "PushE", name = "E: Max Distance", value = 450, min = 100, max = 475, step = 5})
	Callback.Add("Tick", function() self:OnTick() end)
	Callback.Add("Draw", function() self:OnDraw() end)
	if _G.SDK then
		_G.SDK.Orbwalker:OnPreAttack(function(...) self:OnPreAttack(...) end)
		_G.SDK.Orbwalker:OnPostAttackTick(function(...) self:OnPostAttack(...) end)
	elseif _G.PremiumOrbwalker then
		_G.PremiumOrbwalker:OnPreAttack(function(...) self:OnPreAttack(...) end)
		_G.PremiumOrbwalker:OnPostAttack(function() self:OnPostAttack() end)
	end
end

-- Methods

function Vayne:BoltsCount(unit)
	for i = 0, unit.buffCount do
		local buff = unit:GetBuff(i)
		if buff and buff.count > 0 and
			self.HasSilverBolts(buff.name) then
				return buff.count
		end
	end
	return 0
end

function Vayne:HasStealthBuff()
	for i = 0, myHero.buffCount do
		local buff = myHero:GetBuff(i)
		if buff and buff.count > 0 and
			self.IsStealthed(buff.name) then
				return true
		end
	end
	return false
end

function Vayne:HasTumbleBonus()
	for i = 0, myHero.buffCount do
		local buff = myHero:GetBuff(i)
		if buff and buff.count > 0 and
			self.IsTumbleBonus(buff.name) then
				return true
		end
	end
	return false
end

function Vayne:CalcCondemnArrivalTime(unit, pos)
	return Geometry:Distance(pos, Geometry:To2D(
		unit.pos)) / self.E.speed + self.E.delay
end

function Vayne:GetBestTumblePos(target)
	local mPos = PPoint(self.MyPos):Extended(
		Geometry:To2D(mousePos), self.Q.range)
	if target and Manager:IsReady(_E) then
		for i = 40, 140, 10 do
			local theta = MathRad(i)
			repeat theta = theta * -1
				local pos = Geometry:RotateAroundPoint(self.MyPos, mPos, theta)
				if Geometry:Distance(pos, Geometry:To2D(target.pos)) <= self.E.range
					and self:IsAbleToStun(target, pos) then
						self.QueueTimer = GameTimer()
						_G.Control.CastSpell(HK_Q, Geometry:To3D(pos))
						return
				end
			until theta > 0
		end
	end
	self.QueueTimer = GameTimer()
	_G.Control.CastSpell(HK_Q, Geometry:To3D(mPos))
end

function Vayne:GetTarget(range)
	local units = {}
	for i, enemy in ipairs(Manager:GetEnemyHeroes()) do
		if Manager:IsValid(enemy, range, self.MyPos) then
			TableInsert(units, enemy)
		end
	end
	TableSort(units, function(a, b) return self:BoltsCount(a) > self:BoltsCount(b) and
		Manager:CalcPhysicalDamage(myHero, a, 100) / (1 + a.health) * Manager:GetPriority(a) >
		Manager:CalcPhysicalDamage(myHero, b, 100) / (1 + b.health) * Manager:GetPriority(b)
	end)
	return #units > 0 and units[1] or nil
end

function Vayne:IsAbleToStun(unit, pos)
	local pos = pos or self.MyPos
	self.E.radius = unit.boundingRadius or 65
	local arrival = self:CalcCondemnArrivalTime(unit, pos)
	local predPos = Geometry:To2D(_G.PremiumPrediction:GetPositionAfterTime(unit, arrival))
	local endPos = predPos:Extended(pos, -self.VayneMenu.Misc.PushE:Value())
	return WallMap:IntersectsWall(predPos, endPos)
end

function Vayne:UseE()
	if GameTimer() - self.QueueTimer <= 0.25 then return end
	local mode = Manager:GetOrbwalkerMode()
	local units = Manager:GetEnemiesAround(self.MyPos, self.E.range)
	for i, unit in ipairs(units) do
		if self.VayneMenu.Interrupter.UseE:Value() then
			if self.VayneMenu.Interrupter.DashE:Value() then
				local dist = Geometry:DistanceSquared(self.MyPos, Geometry:To2D(unit.pos))
				if dist <= 32400 or (unit.pathing.isDashing and unit.pathing.endPos and
					Geometry:DistanceSquared(self.MyPos, Geometry:To2D(unit.pathing.endPos)) < dist) then
						self.E.radius = unit.boundingRadius or 65
						local pred = _G.PremiumPrediction:GetPrediction(myHero, unit, self.E)
						if pred.CastPos and pred.HitChance >= 0.25 then
							self.QueueTimer = GameTimer()
							_G.Control.CastSpell(HK_E, pred.CastPos); break
					end
				end
			end
			if unit.activeSpell and unit.activeSpell.valid then
				local name = unit.activeSpell.name
				if self.VayneMenu.Interrupter.Spells[name] and self.VayneMenu.Interrupter.Spells[name]["Use"]:Value() and
					self.VayneMenu.Interrupter.Spells[name]["Danger"]:Value() >= self.VayneMenu.Interrupter.DangerE:Value() then
						self.QueueTimer = GameTimer()
						_G.Control.CastSpell(HK_E, unit.pos); break
				end
			end
		end
		local killSteal = false
		if self.VayneMenu.KillSteal.UseE:Value() then
			local lvW, lvE = myHero:GetSpellData(_W).level
				or 1, myHero:GetSpellData(_E).level or 1
			local rawDmg = 35 * lvE + 15
			rawDmg = self:BoltsCount(unit) < 2 and rawDmg or
				rawDmg + (15 * lvW + 35 + (0.025 * lvW + 0.015) * unit.maxHealth)
			local dmg = Manager:CalcPhysicalDamage(myHero, unit,
				rawDmg, self:CalcCondemnArrivalTime(unit, self.MyPos))
			killSteal = unit.health < dmg
		end
		if not Manager:IsAutoAttacking() and (self:IsAbleToStun(unit) and
			((mode == "Combo" and self.VayneMenu.Combo.UseE:Value()) or (mode == "Harass" and
				self.VayneMenu.Harass.UseE:Value()) or self.VayneMenu.Auto.UseE:Value())) or killSteal then
					self.QueueTimer = GameTimer(); _G.Control.CastSpell(HK_E, unit.pos); break
		end
	end
end

-- Events

function Vayne:OnPreAttack(args)
	if myHero:GetSpellData(_R).currentCd > 0 and self:HasStealthBuff()
		and self.VayneMenu.Misc.BlockAA:Value() then
			args.Process = false; return
	end
	local target = self:GetTarget(myHero.range +
		(myHero.boundingRadius or 65) + 65)
	if target == nil then return end;
	self.Target, args.Target = target, target
end

function Vayne:OnPostAttack()
	local mode = Manager:GetOrbwalkerMode()
	if (mode == "Combo" and self.VayneMenu.Combo.UseQ:Value()
		or mode == "Harass" and self.VayneMenu.Harass.UseQ:Value()) then
			self:GetBestTumblePos(self.Target); return
	end
end

function Vayne:OnTick()
	self.MyPos = Geometry:To2D(myHero.pos)
	if _G.JustEvade and _G.JustEvade:Evading() or (_G.ExtLibEvade and
		_G.ExtLibEvade.Evading) or Game.IsChatOpen() or myHero.dead then return end
	if Manager:IsReady(_E) then self:UseE() end
end

function Vayne:OnDraw()
	if Game.IsChatOpen() or myHero.dead then return end
	if self.VayneMenu.Drawings.DrawQ:Value() then
		DrawCircle(myHero.pos, self.Q.range, 1, Draw.Color(96, 0, 250, 154))
	end
	if self.VayneMenu.Drawings.DrawE:Value() then
		DrawCircle(myHero.pos, self.E.range, 1, Draw.Color(96, 255, 140, 0))
	end
	if not self.MyPos then return end
	if self.VayneMenu.Drawings.Track:Value() then
		for i, enemy in ipairs(Manager:GetEnemyHeroes()) do
			if enemy and enemy.valid and enemy.visible then
				local dist = Geometry:DistanceSquared(self.MyPos, Geometry:To2D(enemy.pos))
				DrawLine(myHero.pos:To2D(), enemy.pos:To2D(), 2.5,
					dist < 4000000 and Draw.Color(128, 220, 20, 60)
					or dist < 16000000 and Draw.Color(128, 240, 230, 140)
					or Draw.Color(128, 152, 251, 152))
			end
		end
	end
end

